import React from 'react';
import AddSubmissionType from './components/AddSubmissionTypes';
import AdminNavBar from './components/NavBars/AdminNavBar';
import ViewUser from './components/ViewUsers';
import AllocatePanelMambers from './components/AllocatePanelMembers';
import CreateMarkingScheme from './components/CreateMaarkingScheme';
import UpoladAdmin from './components/UploadAdmin';

import {BrowserRouter, Routes, Route} from 'react-router-dom'

function App(){
    return (
            <BrowserRouter>
                <AdminNavBar/>
                <Routes>
                    <Route path='/viewUser' element={<ViewUser/>}></Route>
                    <Route path='/allocatePanel' element={<AllocatePanelMambers/>}></Route>
                    <Route path='/uploadAdmin' element={<UpoladAdmin/>}></Route>
                    <Route path='/createmarkingScheme' element={<CreateMarkingScheme/>}></Route>
                    <Route path='/addSubmissionType' element={<AddSubmissionType/>}></Route>

                    
                    
                </Routes>
            </BrowserRouter>

    )
}
export default App;
